// LoginTab.js
import * as React from 'react';

const LoginTab = ({ onChange, onSubmit }) => {
  return (
    <div className="tab-pane fade show active" id="pills-login">
      <form onSubmit={onSubmit}>
        <div className="form-outline mb-4">
          <input type="login" id="loginName" name="login" className="form-control" onChange={onChange} />
          <label className="form-label" htmlFor="loginName">Username</label>
        </div>
        <div className="form-outline mb-4">
          <input type="password" id="loginPassword" name="password" className="form-control" onChange={onChange} />
          <label className="form-label" htmlFor="loginPassword">Password</label>
        </div>
        <button type="submit" className="btn btn-primary btn-block mb-4">Sign in</button>
      </form>
    </div>
  );
};

export default LoginTab;
